// Cameron McCarty
// 09/18/2023

import formClass from "./classes.module.css"

function PasswordInput(p) {
    return (
        <div className={formClass.labelGroup}>
                            <label htmlFor="pwd">Password:</label>
                            <input 
                                className={validEmail ? null : formClass.invalidInput}
                                id="pwd" 
                                type="passsword" 
                                name="pwd"
                                onChange={handlePwd}
                                value={pwd}
                                />
                        </div>
    )
}

export default PasswordInput;
